/** Dummy user data. */
export const genderList: RadioButtan[] = [
    { name: '女性', value: '', inputProps: { arealabel: 'gender', val: '' } },
    { name: '男性', value: '', inputProps: { arealabel: 'gender', val: '' } },
    { name: 'どちらでもいい', value: '', inputProps: { arealabel: 'gender', val: '' } }
]
